import React from 'react';
import './App.css';
import './components/codeIn/CodeIn'
import CodeIn from './components/codeIn/CodeIn';


class App extends React.Component {
  constructor(){

    super();
    this.state = {
      input:'',
      items:["1","2","3","4"]
    }
  }

  onInputChange = (event) =>{
    console.log(this.state.input);
    this.setState({input:event.target.value});

  }

  onSubmit = () =>{
    let temp =this.state.items;
    if(this.state.input!==""){
      temp.push(this.state.input);
    }
    this.setState({
      items:temp
    })
  }



  render(){

    return(
      <div className = "App">
        <ul>
          {
            this.state.items.map((val,i)=>{
              return <li key={i}>{val}</li>
            })
          }
          {
            React.createElement('h1',{},'Hello World')
          }
        </ul>
        <CodeIn onSubmit={this.onSubmit} onInputChange = {this.onInputChange}/>
      </div>
    );
  }
}

export default App;
